// Profile.js
import React, { useState, useEffect } from 'react';
import Navbar from '../components/Navbar';
import axios from 'axios';

const Profile = () => {
  const [activeTab, setActiveTab] = useState('profile');
  const [profileData, setProfileData] = useState({
    name: '',
    email: '',
    company: '',
    phone: '',
    address: {
      street: '',
      city: '',
      state: '',
      zip: '',
    },
    bio: '',
    progress: 0,
  });

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const response = await axios.get(`/api/profile/{userId}`);
        setProfileData(response.data);
      } catch (error) {
        console.error('Error fetching profile:', error);
      }
    };
    fetchProfile();
  }, []);

  const renderTabContent = () => {
    switch (activeTab) {
      case 'profile':
        return <ProfileTab profileData={profileData} />;
      case 'security':
        return <SecurityTab />;
      case 'badges':
        return <BadgesTab />;
      case 'activity':
        return <ActivityTab />;
      case 'settings':
        return <SettingsTab />;
      default:
        return <ProfileTab profileData={profileData} />;
    }
  };

  return (
    <div className="bg-background text-text min-h-screen">
      <Navbar />
      <main className="max-w-3xl mx-auto px-4 sm:px-6 lg:px-8 py-16">
        <h1 className="text-4xl font-bold text-center mb-8">Your Profile</h1>
        <div className="tabs">
          <button onClick={() => setActiveTab('profile')} className={`tab ${activeTab === 'profile' ? 'active' : ''}`}>Profile</button>
          <button onClick={() => setActiveTab('security')} className={`tab ${activeTab === 'security' ? 'active' : ''}`}>Security</button>
          <button onClick={() => setActiveTab('badges')} className={`tab ${activeTab === 'badges' ? 'active' : ''}`}>Badges</button>
          <button onClick={() => setActiveTab('activity')} className={`tab ${activeTab === 'activity' ? 'active' : ''}`}>Activity & Stats</button>
          <button onClick={() => setActiveTab('settings')} className={`tab ${activeTab === 'settings' ? 'active' : ''}`}>Account Settings</button>
        </div>
        <div className="tab-content">
          {renderTabContent()}
        </div>
      </main>
    </div>
  );
};

// Profile Tab
const ProfileTab = ({ profileData }) => (
  <div>
    <h2>Profile Progress</h2>
    <p>Complete your profile and take actions to level up!</p>
    <ProgressTracker progress={profileData.progress} />
    {/* Other profile data like name, email, etc. */}
  </div>
);

const ProgressTracker = ({ progress }) => (
  <div>
    <div className="progress-bar">
      <span className="progress" style={{ width: `${progress}%` }}>{progress}% Complete</span>
    </div>
    <ul>
      <li>Add a customer (Completed)</li>
      <li>Add a job (Pending)</li>
      <li>Complete a job (Pending)</li>
    </ul>
  </div>
);

// Security Tab
const SecurityTab = () => (
  <div>
    <h2>Manage Security</h2>
    <p>Change your password, set up 2-factor authentication, and review login history.</p>
  </div>
);

// Badges Tab
const BadgesTab = () => (
  <div>
    <h2>Your Badges</h2>
    <p>Unlock badges by completing milestones!</p>
    <BadgeGallery />
  </div>
);

const BadgeGallery = () => (
  <div className="badge-gallery">
    <div className="badge">Customer Wizard</div>
    <div className="badge">Job Master</div>
    <div className="badge">First Task Completed</div>
  </div>
);

// Activity & Stats Tab
const ActivityTab = () => (
  <div>
    <h2>Your Activity</h2>
    <p>See your job stats, customers added, and other key metrics.</p>
    <StatsOverview />
  </div>
);

const StatsOverview = () => (
  <div>
    <ul>
      <li>Jobs completed: 5</li>
      <li>Customers added: 10</li>
      <li>Revenue generated: $2,500</li>
    </ul>
  </div>
);

// Account Settings Tab
const SettingsTab = () => (
  <div>
    <h2>Account Settings</h2>
    <p>Manage your account preferences and notifications.</p>
  </div>
);

export default Profile;
